def randomString(stringLength=10):
    """Generate a random string of fixed length """
    letters = string.ascii_lowercase
    return ''.join(random.choice(letters) for i in range(stringLength))

def arrayEQ(test,expect):
    if len(test) != len(expect):
        print(str(test) + ' is not eq to ' + str(expect))
        raise ('F Wrong!')
    for i in range(len(test)):
        if test[i] != expect[i]:
            print(str(test) + ' is not eq to ' + str(expect))
            raise('F Wrong!')
    return True


# Python3 program for Naive Pattern
# Searching algorithm
def brutesearch(txt,pat):
    M = len(pat)
    N = len(txt)
    memo = [0 for i in range(len(txt))]
    for i in range(N - M + 1):
        j = 0
        while (j < M):
            if (txt[i + j] != pat[j]):
                break
            j += 1
        if (j == M):
            memo[i] = 1
    return memo


# Python3 program to implement
# wildcard pattern matching
# algorithm

# Function that matches input
# txt with given wildcard pattern
def brutewildCardmatch(txt, pat):
    M = len(pat)
    N = len(txt)
    memo = [0 for i in range(N)]
    for i in range(N - M + 1):
        j = 0
        while (j < M):
            if pat[j] == '?' or (txt[i + j] == pat[j]) :
                j += 1
            else:
                break
        if (j == M):
            memo[i] = 1
    return memo

# This code is contributed
# by sahilhelangia
def bruteGetZarr(string):
    z = [0 for i in range(len(string))]
    n = len(string)
    l, r, k = 0, 0, 0
    z[0] = len(string)
    for i in range(1, n):
        if i > r:
            l, r = i, i
            while r < n and string[r - l] == string[r]:
                r += 1
            z[i] = r - l
            r -= 1
        else:
            k = i - l
            if z[k] < r - i + 1:
                z[i] = z[k]
            else:
                l = i
                while r < n and string[r - l] == string[r]:
                    r += 1
                z[i] = r - l
                r -= 1
    return z

